import React from 'react'
import './infoCard.css'
import {UilPen} from '@'

const InfoCard = () => {
  return (
    <div className='infoCard'>
        <div className="infoHead">
            <h3>Your Info</h3>
        </div>
    </div>
  )
}

export default InfoCard
